import React, { useEffect } from 'react';
import { NavLink } from 'react-router-dom';
import '../../css/home.css';

const Home = (props) => {

  useEffect(() => {
    props.setShowFooter(true);
    document.title = "SHAREHOME - A custom party game";
  });

  return (
    <div className="content">
      <NavLink to="/"><div className="title noselect"></div></NavLink>
      <p className="subtitle">
        A custom party game inspired by Terrace House
      </p>
      <div className="CTAWrapper">
        <div className="callToAction">
          <a href="/play">Play virtually with friends right now!</a>
          <p>(video conferencing not included)</p>
        </div>
        <div className="callToAction">
          <a href="/purchase">Purchase a physical copy</a>
          <p>(when social distancing becomes lame again)</p>
        </div>
        <div className="callToAction">
          <a href="/purchase">Print a shitty paper version</a>
          <p>(free if you have a printer)</p>
        </div>
      </div>
    </div>
  );
}

export default Home;
